import React from "react";
import { Container, Text, PrimaryButton } from "../../styledComponents";
import styled from "styled-components";

const SearchWrapper = styled(Container)`
  width: 100%;
  flex: 0;
  background-color: "blue";
  flex-direction: row;
  justify-content: "space-between";
  padding-right: 100px;
  padding-top: 30px;
  padding-bottom: 30px;
  padding-left: 100px;
  /* background-color: "white"; */
`;
const Houses = () => {
  return <Container column flex={1} color="blue"></Container>;
};

export default Houses;
